        <h3>Enter The Chat Room</h3>
        <div>
            <label>Name:</label>
            <input type="text" placeholder="Pick a name!" name="name" value="{{name}}"></input>
        </div>
        <div class="join">
            <input type="text" placeholder="Room Code" name="code" value = "{{code}}"></input>

        </div>
        </form>
    <form>Create a room</form>
    <form>Join a room</form>
    </div>
    );
};

export default ChatRoom;
